import React from 'react';
import logo from './logo.svg';
import './App.css';
import Checkout from './Checkout'
import Success from './Success'
import Cancel from './Cancel'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
   <div>
     <Router>
     <Switch>
          <Route path="/">
            <Checkout />
          </Route>
          <Route path="/success">
            <Success />
          </Route>
          <Route path="/cancel">
            <Cancel />
          </Route>
        </Switch>
     </Router>

    </div>
  );
}

export default App;
